import './App.css';
import React from 'react';

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = ({apiResponse:""});
  }

  callAPI() {
    fetch("https://localhost:5000/testAPI")
      .then(res => res.text())
      .then(res => this.setState({apiResponse: res}));
  }

  render() {
    return (
      <div className="App">
        <button onClick={() => this.callAPI()}>Click me pls</button>
        <p>{this.state.apiResponse}</p>
      </div>
    );
  }
}

export default App;
